import axios from 'axios'
const API_URL = require('./api');

class InterestService {
    getInterestList() {
        return axios.get(API_URL + "/interests", {
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            }
        })
    }
}

export default new InterestService();
